
(function (ng) {

	var playerCount = 4,
		game = {
			gameCount: 0,
			deck: [],
			trashCards: [],
			windowCards: [],
			betBlind: 4,
			betActive: 4,
			players: [],
			playerActive: 0,
			playerDealer: 0
		};

	function shuffle(array) {
		var counter = array.length, temp, index;

		// While there are elements in the array
		while (counter > 0) {
			// Pick a random index
			index = Math.floor(Math.random() * counter);

			// Decrease counter by 1
			counter--;

			// And swap the last element with it
			temp = array[counter];
			array[counter] = array[index];
			array[index] = temp;
		}

		return array;
	}

	function createDeck() {
		var deck = [];
		for (var value = 2; value <= 14; value++) {
			for (var suite = 0; suite <= 3; suite++) {
				deck.push(value + '.' + suite);
			}
		}
		return deck;
	}

	// new round setup
	function startGame() {
		game.gameCount++;
		if (game.gameCount % 5 === 0) {
			game.betBlind *= 2;
		}
		game.betActive = game.betBlind;

		game.players.forEach(function (v) {
			v.money -= v.bet;

			v.holeCards = [];
			v.bet = 0;
			v.hasActed = false;
			v.hasFolded = false;
		});
		game.players[(game.playerDealer + (playerCount > 2)) % playerCount].bet = Math.min(game.betBlind / 2, game.players[(game.playerDealer + (playerCount > 2)) % playerCount].money);
		game.players[(game.playerDealer + (playerCount > 2) + 1) % playerCount].bet = Math.min(game.betBlind, game.players[(game.playerDealer + (playerCount > 2) + 1) % playerCount].money);
		game.playerActive = (game.playerDealer + (playerCount > 2) + 2) % playerCount;
		for (var i = 0; i < playerCount; i++) {
			if (game.players[(game.playerActive + i) % playerCount].money) {
				game.playerActive = (game.playerActive + i) % playerCount;
				break;
			}
		}

		game.trashCards = [];
		game.windowCards = [];
		game.deck = shuffle(createDeck());
		game.players.forEach(function (v) {
			v.holeCards.push(game.deck.pop());
		});
		game.players.forEach(function (v) {
			v.holeCards.push(game.deck.pop());
		});
	}

	function playerGameState(key, showAll) {
		var localGame = JSON.parse(JSON.stringify(game));
		delete localGame.deck;
		delete localGame.trashCards;
		showAll || localGame.players.forEach(function(v, k) {
			if (k !== key) {
				v.holeCards = v.holeCards.length ? [false, false] : [];
			}
		});
		return localGame;
	}

	function hasPlayerActed(v) {
		return v.hasActed;
	}

	function handleInput(input) {
		if (input.player !== game.playerActive) {
			return false;
		}
		var player = game.players[game.playerActive];

		switch (input.action) {
			case 'check':
				// Cannot check if player bet is less than active bet.
				if (game.betActive > player.bet) {
					return false;
				}
				break;

			case 'call':
				// Cannot call if less money than bet.
				if (player.money < game.betActive) {
					return false;
				}
				player.bet = game.betActive;
				break;

			case 'raise':
				// Cannot bet less than minimum bet
				if (player.bet + input.bet <= game.betActive) {
					debugger;
					return false;
				}
				// Cannot bet more than money remaining
				if (player.bet + input.bet > player.money) {
					return false;
				}
				game.betActive = player.bet += input.bet;
				game.players.forEach(function(v) {
					v.hasActed = v.hasFolded;
				});
				break;

			case 'all-in':
				player.bet = player.money;
				game.betActive = Math.max(game.betActive, player.money);
				break;

			case 'fold':
				// Cannot fold if you can check
				if (player.bet >= game.betActive) {
					return false;
				}
				player.hasFolded = true;
				game.trashCards.concat(player.holeCards);
				player.holeCards = [];
				break;

			default:
				return false;
		}

		do {
			player.hasActed = true;
			game.playerActive = (game.playerActive + 1) % playerCount;
			player = game.players[game.playerActive];

			if (!player.hasActed) {
				if (player.hasFolded) {
					continue; // Folded
				} else if (player.bet > 0 && player.bet === player.money) {
					continue; // All in
				} else if (!player.money) {
					continue; // No money
				} else {
					break;
				}
			}

			if (game.players.every(hasPlayerActed)) {
				break;
			}
		} while (false);

		var playersRemaining = game.players.reduce(function(p, a) {
			return p + !a.hasFolded;
		}, 0);

		var winner = null;
		if (playersRemaining === 1) {
			// Last player standing wins all the pots
			game.players.forEach(function(v, k) {
				if (!v.hasFolded) winner = k;
			});
			game.players.forEach(function(v, k) {
				game.players[winner].money += v.bet;
			});

			game.playerDealer = (game.playerDealer + 1) % playerCount;
			startGame();
		} else if (game.players.every(hasPlayerActed)) {
			if (game.windowCards.length === 5) {
				// Check hands for winner.
				var handScores = [];
				game.players.forEach(function(v, k) {
					if (v.hasFolded) {
						return;
					} else {
//						console.time(game.gameCount + ': ' + v.name);
						handScores.push({player: k, score: handEvaluator(v.holeCards.concat(game.windowCards)), hand: game.windowCards.join(',') + ' + ' + v.holeCards.join(',')});
//						console.timeEnd(game.gameCount + ': ' + v.name);
					}
				});
				handScores = handScores.sort(function(a, b) { return a.score > b.score ? -1 : a.score < b.score; });

				handScores.forEach(function(scoring) {
					var winner = scoring.player, winningBet = game.players[winner].bet;
					game.players.forEach(function(v, k) {
						var pot = Math.min(v.bet, winningBet);
						game.players[winner].money += pot;
						v.money -= pot;
						v.bet -= pot;
					});
				});

				game.playerDealer = (game.playerDealer + 1) % playerCount;
				startGame();
			} else {
				// Deal next card(s)
				game.trashCards.push(game.deck.pop());
				do {
					game.windowCards.push(game.deck.pop());
				} while (game.windowCards.length < 3);

				// Select active player
				game.players.forEach(function(v) {
					v.hasActed = v.hasFolded;
				});
				game.playerActive = (game.playerDealer + (playerCount > 2) + 2) % playerCount;
				do {
					game.playerActive = (game.playerActive + 1) % playerCount;
				} while (game.players[game.playerActive].hasActed);
			}
		}

		return true;
	}

	function getPrimes(max) {
		var sieve = [], i, j, primes = [];
		for (i = 2; i <= max; ++i) {
			if (!sieve[i]) {
				// i has not been marked -- it is prime
				primes.push(i);
				for (j = i << 1; j <= max; j += i) {
					sieve[j] = true;
				}
			}
		}
		return primes;
	}
	var primeSequence = getPrimes(50);
	var primes = {};
	for (var i = 1; i <= 14; i++) {
		primes[i] = primeSequence[i - 1];
	}

	function w(o, v) {
		o.i = v || 1;
		return o;
	}

	function handEvaluator(hand) {
		hand = hand.sort(function(a, b) { a = parseInt(a), b = parseInt(b); return a > b ? -1 : a < b; });

		var suiteCount = hand.reduce(function(p, a) { p[Math.round(a % 1 * 10)] = (p[Math.round(a % 1 * 10)] || 0) + 1; return p; }, {});
		var suiteSort = Object.keys(suiteCount).map(function(k) { return {s: k, c: suiteCount[k]}; }).sort(function(a, b) { return a.c > b.c ? -1 : a.c < b.c; });
		var valueCount = hand.reduce(function(p, a) { if (!p[Math.round(a)]) p[Math.round(a)] = 0; p[Math.round(a)]++; return p; }, {});
		var valueCountSort = Object.keys(valueCount).map(function (k) {
			return {v: parseInt(k), c: valueCount[k]};
		}).sort(function (a, b) {
			if (a.c === b.c) return a.v > b.v ? -1 : a.v < b.v;
			return a.c > b.c ? -1 : a.c < b.c;
		});

		var straight = (function() {
			var match = [], stop = false, handWrapping = [];
			hand.forEach(function(x) { handWrapping.push(x); if (x >= 14) handWrapping.push(1); });
			var valueSort = Object.keys(handWrapping.reduce(function(p, a) { p[Math.round(a)] = 1; return p; }, {})).map(function(x) { return Math.round(x); }).sort(function(a, b) { return b - a; });

			valueSort.forEach(function(v) {
				if (stop) return;
				if (!match.length || match[0] != v * 1 + 1) {
					if (match.length >= 5) {
						stop = true;
						return;
					}
					match = [v];
				} else {
					match.unshift(v);
				}
			});
			return match;
		})();
		var straightFlush = (function() {
			if (suiteSort[0].c < 5 || straight.length < 5) {
				return [];
			}
			if (straight.length === 5) {
				if (straight.every(function(x) { return hand.indexOf((x < 2 ? 14 : x) + '.' + suiteSort[0].s) >= 0; })) {
					return straight;
				} else {
					return [];
				}
			} else {
				var match = [], stop = false;
				straight.forEach(function(x) {
					if (stop) return;
					if (hand.indexOf((x === 1 ? 14 : x) + '.' + suiteSort[0].c) >= 0) {
						match.push(x);
					} else {
						if (match >= 5) {
							stop = true;
							return;
						}
						match = [x];
					}
				});
				return match.length >= 5 ? match.slice(0, 5) : [];
			}
		})();
		var hasStraightFlush = straightFlush.length >= 5;
		var hasStraight = straight.length >= 5;
		var hasFlush = suiteSort[0].c >= 5;
		var hasFour = valueCountSort[0].c >= 4;
		var hasThree = valueCountSort[0].c >= 3;
		var hasFullHouse = valueCountSort[0].c >= 3 && valueCountSort[1].c >= 2;
		var hasTwoPairs = valueCountSort[0].c >= 2 && valueCountSort[1].c >= 2;
		var hasPair = valueCountSort[0].c >= 2;

		var scoringHand = [], scoringPrefix = 0;
		if (hasStraightFlush) {
			var prev = 14;
			if (straight.every(function(x) { prev--; return prev === x; })) {
				// is royal flush?
				scoringHand = straightFlush.slice(0, 5).map(function(v) { return w({v: v, c: 1}); });
				scoringPrefix = 9;
			} else {
				// is straight flush?
				scoringHand = straight.slice(0, 5).map(function(v, i) { return w({v: v, c: 1}, -Math.pow(10, 5 - i)); });
				scoringPrefix = 8;
			}
		} else if (hasFour) {
			scoringHand = [w(valueCountSort[0]), {v: valueCountSort[1].v, c: 1}];
			scoringPrefix = 7;
		} else if (hasFullHouse) {
			scoringHand = [w(valueCountSort[0], 1000), {v: valueCountSort[1].v, c: 2}];
			scoringPrefix = 6;
		} else if (hasFlush) {
			scoringHand = hand.map(function(x, i) { return w({v: parseInt(x), s: Math.round(x % 1 * 10), c: 1}, -Math.pow(10, 5 - i)); })
				.reduce(function(p, a) { if (a.s === suiteSort[0].s && p.length < 5) p.push(a); return p; }, []);
			scoringPrefix = 5;
		} else if (hasStraight) {
			scoringHand = straight.map(function(v) { return w({v: v, c: 1}); });
			scoringPrefix = 4;
		} else if (hasThree) {
			scoringHand = [w(valueCountSort[0], 1000), w(valueCountSort[1], -100), w(valueCountSort[2], -1)];
			scoringPrefix = 3;
		} else if (hasTwoPairs) {
			scoringHand = [w(valueCountSort[0], 10000), w(valueCountSort[1], -100), w(valueCountSort[2], -1)];
			scoringPrefix = 2;
		} else if (hasPair) {
			scoringHand = [w(valueCountSort[0], 10000), w(valueCountSort[1], -1000), w(valueCountSort[2], -10), w(valueCountSort[3], -1)];
			scoringPrefix = 1;
		} else {
			scoringHand = hand.slice(0, 5).map(function(x, i) { return w({v: parseInt(x), c: 1}, -Math.pow(10, 5 - i)); });
		}
		var primeScore = scoringPrefix * 1000000000 + scoringHand.reduce(function(p, a) { return a.i > 0 ? p * (Math.pow(primes[a.v], a.c) * a.i) : p + a.v * a.c * (a.i ? -a.i : 1); }, 1);

//		console.log(primeScore, scoringHand.map(function(x) { return Array(x.c + 1).join('a').split('').map(function(y) { return x.v; }).join(', '); }).join(', '));
//		console.log(scoringHand);
//		console.log({
//			scoringPrefix: scoringPrefix,
//			scoringHand: scoringHand.map(function(x) { return Array(x.c + 1).join('a').split('').map(function(y) { return x.v; }).join(', '); }).join(', '),
//			primeScore: primeScore,
//			hasStraight: hasStraight,
//			hasFlush: hasFlush,
//			hasFour: hasFour,
//			hasFullHouse: hasFullHouse,
//			hasThree: hasThree,
//			hasTwoPairs: hasTwoPairs,
//			hasPair: hasPair
//		});

		return primeScore;
	}

	for (var i = 0; i < playerCount; i++) {
		game.players.push({
			name: 'Player ' + i,
			money: 500,
			holeCards: [],
			bet: 0,
			hasActed: false,
			hasFolded: false
		});
	}

	game.playerDealer = Math.floor(Math.random() * playerCount);

	startGame();

	ng.module('game.app', []);
	ng.module('game.app').controller('GameController', ['$scope', '$interval',
		function ($scope, $interval) {
//			delete game.deck;
//			delete game.trashCards;
//			delete game.windowCards;
//			game.players.forEach(function(v) { delete v.holeCards; });
			$scope.game = game;

			var timer = $interval(function() {
				var actions = [], player = game.players[game.playerActive];
				if (player.bet === game.betActive) {
					actions.push('check', 'check', 'check', 'check');
					Math.random() < 0.85 || game.betActive > 50 || actions.push('raise');
				} else if (player.bet < game.betActive && player.money >= game.betActive) {
					actions.push('call', 'fold', 'call', 'call', 'call');
					Math.random() < 0.85 || game.betActive > 50 || actions.push('raise');
				} else if (player.money < game.betActive) {
					actions.push('all-in', 'fold', 'fold');
				} else {
					debugger;
				}

				var action = actions[Math.floor(Math.random() * actions.length)];
				handleInput({player: game.playerActive, action: action, bet: 6 + game.betActive - player.bet});

				$scope.lastAction = action;
				$scope.totalMoney = game.players.reduce(function(p, a) { return p + a.money; }, 0);
				if (game.players.reduce(function(p, a) { return p + (a.money > 0); }, 0) <= 1) {
					$interval.cancel(timer);
				}
			}, 100);
		}]);

})(window.angular);

